import { LOGO_URL } from "../utils/constant";
import { Link } from 'react-router-dom';

const Header = () => {
    return (
      <div className="header">
        <div className="Logo-Container">
          <img
            className="logo"
            src={LOGO_URL}
            alt="FoodDelivery"
          />
        </div>
        <div className="nav-Items">
          <ul>
            <li>Home</li>
           <li >About Us </li>
            <li>Contact Us</li>
            <li>Cart</li>
          </ul>
        </div>
      </div>
    );
  };

  export default Header;
